import React from "react";
import myImage from "../image/pic2.jpg";

function LoginComp() {
  return (
    <div>
      <div className="absolute">
        <img
          src={myImage}
          alt="Illustration of a person logging into the system"
          className="w-1/2 rounded-xl shadow-xl"
        />
        {/* <div className="absolute top-44 left-96 w-1/2 h-1/2 bg-white drop-shadow-xl rounded-2xl">
        </div> */}
      </div>
    </div>
  );
}

export default LoginComp;
